// Bootstrap CSS
import "bootstrap/dist/css/bootstrap.min.css";
import image_2 from "../Images/image_2.png";

function Home() {
    return(
        <div style={{width:"70%", marginLeft:"15%", marginTop:"10px"}}>
            <div style={{background:"lightgray", alignItems:"center"}}>
                <p style={{fontWeight:"bold", textAlign:"center", fontSize:"50px"}}>
                    Hope Living and sheyt!
                </p>
            </div>
            <img src={image_2} style={{height:"20px"}} class="h-100" />
        </div>
    );
    
}

export default Home;
